for ii=1:14
  a=y1(ii,:);
  [partition,codebook] = lloyds(a,2^4);
  N=length(partition)+1;  
  for i=1: length(a)
     if a(i)>partition(N-1)
         c(i)=N; 
     else if  a(i)<=partition
           c(i)=1;   
         else
            for j=1:N-2 
            if  partition(j)<a(i)&a(i)<=partition(j+1)  
            c(i)=j+1;
            end
            end
        end
     end  
  end
  C1(ii,:)=c;%Ñ¡ÓÃ²âÊÔÊý¾ÝÑù±¾
end
